e"":""PRIMARY"",""url"":""https://www.rsc.org/Merck-Index/monograph/M8348?q\u003dauthorize"",""references"":[""46d8b249-4e8b-42a5-b3e5-e7b0087143a7"",""230544fd-5cc4-441d-80be-59744c9b9298""],""access"":[],""_self"":""/ginas/app/api/v1/codes(7806cfc7-4c98-4c51-95cf-90641e076427)?view\u003dfull""},{""uuid"":""eaede043-064e-4b2c-abe0-6400f3ff0a46"",""created"":1451593573001,""createdBy"":""DARRYL.METZLER"",""lastEdited"":1454445831001,""lastEditedBy"":""DARRYL.METZLER"",""deprecated"":false,""codeSystem"":""WHO INTERNATIONAL PHARMACOPEIA"",""code"":""OXYTOCIN"",""comments"":""Description: White or almost white powder. Solubility: Very soluble in water. It dissolves in dilute solutions of acetic acid and of ethanol. Category: Uterine-stimulating (Oxytocic). Storage: Oxytocin should be kept in an airtight container, protected from light, at a temperature of 2 ?C to 8 ?C or if sterile, in asterile, airtight, tamper-evident container. Labelling: The label states:- where applicable, that the substance is free from bacterial endotoxins,- where applicable, that the substance is sterile.Additional information: Oxytocin is hygroscopic. Definition: Oxytocin is a synthetic cyclic nonapeptide having the structure of the hormone produced by the posterior lobe of thepituitary gland that stimulates contraction of the uterus and milk ejection in receptive mammals. It is available in the freeze-dried form as an acetate. Oxytocin contains not less than 93.0% and not more than 103.0% of the peptide C43H66N12O12S2, calculated with reference tothe anhydrous, acetic acid-free substance.By convention, for the purpose of labelling oxytocin preparations, 1 mg of oxytocin peptide (C43H66N12O12S2) is equivalent to 600 IU of biological activity."",""type"":""PRIMARY"",""url"":""http://apps.who.int/phint/pdf/b/Jb.6.1.304.pdf"",""references"":[""46d8b249-4e8b-42a5-b3e5-e7b0087143a7"",""230544fd-5cc4-441d-80be-59744c9b9298""],""access"":[],""_self"":""/ginas/app/api/v1/codes(eaede043-064e-4b2c-abe0-6400f3ff0a46)?view\u003dfull""},{""uuid"":""830c2c01-0618-4d43-9110-2562635b914e"",""created"":1454043600001,""createdBy"":""SWITZERF"",""lastEdited"":1454043600001,""lastEditedBy"":""SWITZERF"",""deprecated"":false,""codeSystem"":""RXCUI"",""code"":""7824"",""comments"":""RxNorm"",""type"":""PRIMARY"",""url"":""https://rxnav.nlm.nih.gov/REST/rxcui/7824/allProperties.xml?prop\u003dall"",""references"":[""46d8b249-4e8b-42a5-b3e5-e7b0087143a7"",""230544fd-5cc4-441d-80be-59744c9b9298""],""access"":[],""_self"":""/ginas/app/api/v1/codes(830c2c01-0618-4d43-9110-2562635b914e)?view\u003dfull""},{""uuid"":""f7d7d5ff-7c76-4ba3-896d-5aa49f36b590"",""created"":1446538489001,""createdBy"":""CALLAHANL"",""lastEdited"":1446538489001,""lastEditedBy"":""CALLAHANL"",""deprecated"":false,""codeSystem"":""IUPHAR"",""code"":""2174"",""type"":""PRIMARY"",""url"":""http://www.guidetopharmacology.org/GRAC/LigandDisplayForward?ligandId\u003d2174"",""references"":[""46d8b249-4e8b-42a5-b3e5-e7b0087143a7"",""230544fd-5cc4-441d-80be-59744c9b9298""],""access"":[],""_self"":""/ginas/app/api/v1/codes(f7d7d5ff-7c76-4ba3-896d-5aa49f36b590)?view\u003dfull""},{""uuid"":""63e91e77-e396-4146-94c0-c7cff36c0354"",""created"":1410926400001,""createdBy"":""GHAZZAOUIR"",""lastEdited"":1410926400001,""lastEditedBy"":""GHAZZAOUIR"",""deprecated"":false,""codeSystem"":""INN"",""code"":""1480"",""type"":""PRIMARY"",""url"":""https://mednet-communities.net/inn/db/ViewINN.aspx?i\u003d1480"",""references"":[""46d8b249-4e8b-42a5-b3e5-e7b0087143a7"",""230544fd-5cc4-441d-80be-59744c9b9298""],""access"":[],""_self"":""/ginas/app/api/v1/codes(63e91e77-e396-4146-94c0-c7cff36c0354)?view\u003dfull""},{""uuid"":""eec630f5-b146-48b0-a493-ada32a2dbb61"",""created"":1402166669001,""createdBy"":""CALLAHANL"",""lastEdited"":1402166669001,""lastEditedBy"":""CALLAHANL"",""deprecated"":false,""codeSystem"":""EVMPD"",""code"":""SUB09580MIG"",""type"":""PRIMARY"",""references"":[""46d8b249-4e8b-42a5-b3e5-e7b0087143a7"",""230544fd-5