        [TestMethod]
		public void JsonParseToObjectAndTestRetrieval()
		{
            string json = @"{
                'test':'worked'   
            }";

            JObject o = JObject.Parse(json);

            string val = o.GetValue("test").ToString();
            Assert.AreEqual("worked", val);
		}

        [TestMethod]
        public void JsonPathRetrievalTest()
        {
            string json = @"{
                'array':[{
                     'prop1':'val1'
                },
                {
                     'prop2':'val2'
                }]
            }";


            
            JObject o = JObject.Parse(json);
            JToken acme = o.SelectToken("$..prop2");

            string val = acme.ToString();
            Assert.AreEqual("val2", val);
        }

        [TestMethod]
        public void ParseAndLocateSequencesInProteinJSON()
        {
            string s1 = "EVKLEESGGGLVQPGGSMKLSCVASGFIFSNHWMNWVRQSPEKGLEWVAEIRSKSINSATHYAESVKGRFTISRDDSKSAVYLQMTDLRTEDTGVYYCSRNYYGSTYDYWGQGTTLTVS";
            string s2 = "DILLTQSPAILSVSPGERVSFSCRASQFVGSSIHWYQQRTNGSPRLLIKYASESMSGIPSRFSGSGSGTDFTLSINTVESEDIADYYCQQSHSWPFTFGSGTNLEVK";

            HashSet<string> uniqs = new HashSet<string>();
            uniqs.Add(s1);
            uniqs.Add(s2);

            JObject o = JObject.Parse(ProteinJSON1);
            List<JToken> acme = o.SelectTokens("$..protein..sequence").ToList();

            HashSet<string> uniqs2 = new HashSet<string>();
            acme.ForEach((f) => {
                uniqs2.Add(f.ToString());
            });


            Assert.IsTrue(uniqs.IsSubsetOf(uniqs2));
            Assert.IsTrue(uniqs.IsSupersetOf(uniqs2));
        }

      

