        /// <summary>
        /// Tests that an SPL snippet is contained within a specific
        /// string, removing all GUID-like strings and then standardizing
        /// non-alphanumeric characters. This isn't a perfect test, as it
        /// is too forgoving in some cases (it allows invalid XML, for example,
        /// like multiple &gt; symbols), and it is too strict in other cases
        /// (for example dates and order of xml elements will fail this test).
        /// </summary>
        /// <param name="haystack">The source string to test for a contained piece</param>
        /// <param name="needle">The XML snippet to look for inside the haystack</param>
        /// <returns></returns>
        public static bool cleanedContains(String haystack,String needle) {
            String c1 = Regex.Replace(haystack, "[a-z0-9]{8}-[a-z0-9]{4}-[a-z0-9]{4}-[a-z0-9]{4}-[a-z0-9]{12}", "");
            c1 = Regex.Replace(c1, "[^0-9A-Za-z<>]", "");
            String c2 = Regex.Replace(needle, "[a-z0-9]{8}-[a-z0-9]{4}-[a-z0-9]{4}-[a-z0-9]{4}-[a-z0-9]{12}", "");
            c2 = Regex.Replace(c2, "[^0-9A-Za-z<>]", "");
            return c1.Contains(c2);
        }

