        public void ParseAndExtractProteinSameHashWithDifferentModificationOrder() {

            JObject o = JObject.Parse(ProteinWith3Modifications);
            Protein protein = new Protein();
            SplDocument splDoc = new SplDocument(protein) { DocId = Guid.NewGuid(), SetId = Guid.NewGuid(), Version = 1 };

            protein.readFromJson(o, splDoc);
            protein.Canonicalize();

            //YP changing expected UIDs based on the addition of amount for modifications
            //Assert.AreEqual("ca60e00d91f846b9ab8edce9567755e5", protein.UID);
            //Assert.AreEqual("35365adbdb0e8b0b63861948d70ce3af", protein.UID);
            Assert.AreEqual("d352f32b9b56d63824442de0de0551f1", protein.UID);
            

            List<ProteinModification> modsWere=protein.Modifications;
            List<int[]> shuffled = new List<int[]>();
            shuffled.Add(new int[] { 0, 1, 2 });
            shuffled.Add(new int[] { 0, 2, 1 });
            shuffled.Add(new int[] { 1, 0, 2 });
            shuffled.Add(new int[] { 1, 2, 0 });
            shuffled.Add(new int[] { 2, 0, 1 });
            shuffled.Add(new int[] { 2, 1, 0 });

            for (int i = 0; i < 6; i++) {
                List<ProteinModification> nmods = new List<ProteinModification>();
                nmods.Add(modsWere[shuffled[i][0]]);
                nmods.Add(modsWere[shuffled[i][1]]);
                nmods.Add(modsWere[shuffled[i][2]]);
                protein.Modifications = nmods;
                protein.Canonicalize();
                Assert.AreEqual("d352f32b9b56d63824442de0de0551f1", protein.UID);
            }

        }

