        [TestMethod]
        public void EnsureSortOrderOnConnectorsIsCorrectNLowestFirst() {
            Fragment f = new Fragment();
            f.AddConnectorsPairCanonical(0, 5,null);
            f.AddConnectorsPairCanonical(10, 21, null);
            f.AddConnectorsPairCanonical(3, 0, null);
            f.AddConnectorsPairCanonical(20, 11, null);
            f.AddConnectorsPairCanonical(0, 15, null);
            f.SortConnectors();

            Assert.AreEqual(3,f.Connectors[0].Snip.Item1);
            Assert.AreEqual(0, f.Connectors[0].Snip.Item2);
            Assert.AreEqual(10, f.Connectors[1].Snip.Item1);
            Assert.AreEqual(21, f.Connectors[1].Snip.Item2);
            Assert.AreEqual(20, f.Connectors[2].Snip.Item1);
            Assert.AreEqual(11, f.Connectors[2].Snip.Item2);
            Assert.AreEqual(0, f.Connectors[3].Snip.Item1);
            Assert.AreEqual(5, f.Connectors[3].Snip.Item2);
            Assert.AreEqual(0, f.Connectors[4].Snip.Item1);
            Assert.AreEqual(15, f.Connectors[4].Snip.Item2);


            /*
             * N	C	Rank
NA	5	4
10	21	2
3	NA	1
20	11	3
NA	15	5
*/
        }
