        [TestMethod]
        public void ParseAndExtractProteinStructuralModificationJSON()
        {

            JObject o = JObject.Parse(ProteinJSON2);
            Protein protein = new Protein();
            SplDocument splDoc = new SplDocument(protein) { DocId = Guid.NewGuid(), SetId = Guid.NewGuid(), Version = 1 };


            protein.readFromJson(o, splDoc);

            StructuralModificationGroup mod = (StructuralModificationGroup)protein.Modifications.Find(m => m is StructuralModificationGroup);

            Assert.AreEqual(mod.Modification.Fragment.UNII, "4JDT453NWO");
            Assert.AreEqual(mod.ResidueSites.Count(), 1);
            Assert.AreEqual(mod.ResidueSites[0].Subunit.Ordinal, 1);
            Assert.AreEqual(mod.ResidueSites[0].Position, 8);
            


        }

