        [TestMethod]
        public void ParseAndExtractProteinMWJSON()
        {
            JObject o = JObject.Parse(ProteinJSON2);
            Protein protein = new Protein();
            SplDocument splDoc = new SplDocument(protein) { DocId = Guid.NewGuid(), SetId = Guid.NewGuid(), Version = 1 };


            protein.readFromJson(o, splDoc);
            /*
            MWEIGHT Method:NUMBER
MWEIGHT Type: CALCULATED
 MWEIGHT Amount:< quantity xmlns = "urn:hl7-org:v3" >
  
    < numerator value = "1090" unit = "DA" />
     
       < denominator value = "1" unit = "1" />
        </ quantity >*/
            Assert.AreEqual(protein.MolecularWeight.Amount.Numerator, 1090);
            Assert.AreEqual(protein.MolecularWeight.Amount.Denominator, 1);
            Assert.AreEqual("1", protein.MolecularWeight.Amount.DenominatorUnit);
            Assert.AreEqual("CALCULATED", protein.MolecularWeight.WeightMethod);
            Assert.AreEqual("NUMBER", protein.MolecularWeight.WeightType);

        }


        [TestMethod]
        public void ParseAndExtractProteinGlycosylationJSON(){
            Protein protein = new Protein();
            SplDocument splDoc = new SplDocument(protein) { DocId = Guid.NewGuid(), SetId = Guid.NewGuid(), Version = 1 };
            JObject o = JObject.Parse(ProteinJSONGL);
            protein.readFromJson(o, splDoc);
            
            Assert.AreEqual(3, protein.Glycosylations.Count());

            HashSet<string> gexpected = new HashSet<string>();
            gexpected.Add("G:N=>1_91");
            gexpected.Add("G:N=>1_94");
            gexpected.Add("G:N=>1_99");

            HashSet<string> gfound = new HashSet<string>();

            protein.Glycosylations.ForEach((g)=>{
                gfound.Add("G:" + g.Attachment.AttachmentType + "=>"
                     + g.Attachment.Site.Subunit.Ordinal + "_"
                     + (g.Attachment.Site.Position + 1));
            });
            Assert.IsTrue(gfound.IsSubsetOf(gexpected));
            Assert.IsTrue(gfound.IsSupersetOf(gexpected));


        }

        [TestMethod]
        [DeploymentItem(@"registry.sdf")]
        [DeploymentItem(@"NA_Fragments.sdf")]
        [DeploymentItem(@"NA_Fragments_dictionary.txt")]
        [DeploymentItem(@"nucleic_acids.json")]
        public void ParseAndExtractProteinAgentModificationJSON()
        {
            Protein protein = new Protein();
            SplDocument splDoc = new SplDocument(protein) { DocId = Guid.NewGuid(), SetId = Guid.NewGuid(), Version = 1 };
            JObject o = JObject.Parse(ProteinAgentModificationJSON);
            protein.readFromJson(o, splDoc);

            AgentModification mod = (AgentModification)protein.Modifications.Find(m => ((AgentModification)m).AgentId.Equals("LH8L0PQC3P"));

            Assert.IsNotNull(mod);
            Assert.AreEqual(mod.Role, "RADIOLABEL");
            Assert.AreEqual(mod.Agent, "IODINE I-124");
            Assert.AreEqual(mod.AgentId, "LH8L0PQC3P");
            //Assert.AreEqual(mod.RelationTypeApprovalID, "539B57DFJF");
        }


